from befree.api_model.config.headers import Headersfrom befree.api_model.orders.private.orders.endpoints import Endpointsfrom befree.api_model.orders.private.orders.payloads import Payloadsfrom befree.api_model import apifrom requests import Responseclass Orders:    def __init__(self):        self._endpoints = Endpoints()        self._payloads = Payloads()        self._headers = Headers()    def list_unsent_orders(self, query="", page=1, per_page=10):        response: Response = api.orders_private_session.post(            url=self._endpoints.list_unsent_orders,            data=self._payloads.list_unsent_orders(query=query, page=page, per_page=per_page),            headers=self._headers.common,        )        return response    def list_receipts(self, query="", withoutReceipt=False, page=1, per_page=10):        response: Response = api.orders_private_session.post(            url=self._endpoints.list_receipts,            data=self._payloads.list_receipts(query=query, withoutReceipt=withoutReceipt, page=page, per_page=per_page),            headers=self._headers.common,        )        return response    def reprint_receipt(self, order_id):        response: Response = api.orders_private_session.post(            url=self._endpoints.reprint_receipt,            data=self._payloads.reprint_receipt(order_id=order_id),            headers=self._headers.common,        )        return response    def resend_order(self, order_id):        response: Response = api.orders_private_session.post(            url=self._endpoints.resend_order,            data=self._payloads.resend_order(order_id=order_id),            headers=self._headers.common,        )        return response    def cancel_order(self, order_id):        response: Response = api.orders_private_session.post(            url=self._endpoints.cancel_order,            data=self._payloads.cancel_order(order_id=order_id),            headers=self._headers.common,        )        return response